Il nous fallait 40 œufs pour 14 personnes. Super bon et un peu bourratif, les œufs se sont mariés avec des haricots blancs, bacons, toasts avocat, tomates cuites, fromage, saucisses, pancakes...😊

Recette :
• 1 brique de crème liquide 
• 8 œufs 
• sel, poivre 
• 5g de beurre 

1) Faites chauffer une poêle avec 5g de beurre.
2) Battez les œufs avec la crème.
3) Mettez les œufs dans la poêle et remuez souvent.
5) Lorsque les œufs sont baveux vous pouvez les retirer.

