.
Vanilla crêpes .
1.5 cup plain flour 
2 tbsp coconut sugar 
1 tsp baking powder
3 tbsp oil/butter, melted
1 tsp vanilla
1 cup almond mylk 
1 cup sparkling water
.
.
Add all dry ingredients to a bowl and mix with a whisk to break up any lumps. Pour in the wet ingredients and mix until smooth. The mixture should be thick, but run easily off a spoon, add a tbsp more milk if you need to. Allow to rest for at least 10 mins. 
Heat up a non stick frying pan to a medium heat, then pour in a ladle of batter, quickly moving the pan to spread evenly on the bottom. Cook until the edges start to curl and bubbles form, about 45 seconds per side. Flip and repeat. Keep crêpes warm under a clean tea towel or in a low oven until ready to serve. Serve with whipped coconut cream, berry compote and fresh raspberries!
.
